INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, 1, 1, 40011, 0, 24001, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 321, 125801);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (2, 1, 1, 40011, 0, 24001, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 322, 126001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (3, 1, 1, 40011, 0, 24001, "プレシア", "んーと。\nこれ、あげる。\nはい", 2, 323, 126101);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (4, 2, 1, 40011, 0, 24001, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 324, 125801);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (5, 2, 1, 40011, 0, 24001, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 325, 126001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (6, 2, 1, 40011, 0, 24001, "プレシア", "お兄。\nきてくれて、うれしい", 2, 326, 126101);
